SET standard_conforming_strings = ON;
CREATE SCHEMA "geodata";
DROP TABLE IF EXISTS "geodata"."estacoes" CASCADE;
BEGIN;
CREATE TABLE "geodata"."estacoes"();
ALTER TABLE "geodata"."estacoes" ADD COLUMN "ogc_fid" SERIAL CONSTRAINT "estacoes_pk" PRIMARY KEY;
SELECT AddGeometryColumn('geodata','estacoes','wkb_geometry',4326,'POINT',2);
ALTER TABLE "geodata"."estacoes" ADD COLUMN "regiao" VARCHAR;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "uf" VARCHAR;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "estacao" VARCHAR;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "codigo" VARCHAR;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "latitude" FLOAT8;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "longitude" FLOAT8;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "altitude" FLOAT8;
ALTER TABLE "geodata"."estacoes" ADD COLUMN "data_de_fundacao" VARCHAR;
CREATE INDEX "estacoes_wkb_geometry_geom_idx" ON "geodata"."estacoes" USING GIST ("wkb_geometry");
COMMIT;
